import React, { Component } from "react";

export class Register extends Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {}
  render() {
    return (
      <div className="inner-container">
        <div className="header">Register</div>
        <div className="box">
          <div className="input-group">
            <label className="login-label" for = "username">Username </label>
            <input className="login-input" type="text" id = "username"></input>
          </div>

          <div className="input-group">
            <label className="login-label">Password </label>
            <input className="login-input" type="text" id = "password"></input>
          </div>

          <div className="input-group">
            <label className="login-label">Email </label>
            <input className="login-input" type="text"></input>
          </div>

          <button className="login-btn" onClick={this.handleClick}>
            Register
          </button>
        </div>
      </div>
    );
  }
}
